import React, { useEffect, useState } from 'react'
import { useNavigate } from 'react-router-dom';
import initialData from '../initial-data/initial-data.json';


const Footer = () => {
    const navigate = useNavigate();

    return (
        <div>
            <button onClick={navigate('my-favorites')}>שיעורים שהזמנתי</button>
        </div>
    )
}

export default Footer
